import styled from "styled-components";

export const FriendItemStyled = styled.li`
  display: block;
  width: 200px;
  height: 50px;

  box-shadow: 0px 2px 4px white;
`;

export const IndicatorStyled = styled.div`
  width: 20px;
  height: 20px;
  border-radius: 50%;

  background-color: red;
`;

export const FotoStyled = styled.img`
  width: 40px;
  height: 40px;
`;
